import React, { Component } from "react";
import Navbar from "./navbar";
//import auth from "../auth";

class DashBoard extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <Navbar />
        <div id="center_container"></div>
      </React.Fragment>
    );
  }
}

export default DashBoard;
